import React, { useState, useRef } from 'react'
import TodoForm from './TodoForm'
import Todo from './Todo'

const TodoList = () => {

  const [todos, setTodos] = useState ([]);

  const addTodo = todo => {
    if(!todo.text || /^\s*$/.test(todo.text)){
      return;
    }

    const newTodos = [todo, ...todos];
    setTodos(newTodos);

  };



  return (
    <div>TodoList</div>
  )
}

export default TodoList
